import React, { Component } from "react";
import "./SeasonSearch.css";

class SeasonSearch extends Component {
    constructor(){
        super();
    }

    render() {
        const season1 = "http://www.nokeynoshade.party/api/seasons/1";

        return (
            <div className="wrapper">
                <div className="seasonSearchContainer">
                    <a href="#"
                        onClick={() => this.getQueens(season1)}
                    >
                        <div>
                            <img src="" alt=""/>
                            <p></p>
                        </div>
                    </a>
                    <div></div>
                    <div></div>
                    <div></div>
                    <div></div>
                    <div></div>
                    <div></div>
                    <div></div>
                    <div></div>
                    <div></div>
                </div>
            </div>
        )
    }

}



export default SeasonSearch;
